    const authcontext = useContext(AuthContext);
    const {authstate}= authcontext;
    if(!authstate.isAuthenticated)
    {
            return <Redirect to='/login'/>
    }
    return ( 
        <div className="container">
             <div className="row">
                 <div className="col">
                    <addressform/>
                 </div>
                 <div className="col">
                      hello
                 </div>
             </div>
        </div>
     );
}
 
export default Address;
